import React from 'react';
import { Card, CardContent, Typography } from "@material-ui/core";

const MyCard =()=>{

    const getMatchCart=()=>{
        return (
            <Card>
                <CardContent>
                    <Typography>This is card</Typography>
                </CardContent>
                <CardActions>
                    <Button variant="contained" color="primary">
                      Show Detail
                    </Button>
                    <Button variant="contained" color="primary">
                        {new Date().toString()}
                    </Button>
                    
                </CardActions>

            </Card>
        );
    };

    return getMatchCart();

   
};
export default MyCard;
